export const ROOT = '/';
export const CATALOG = '/catalog';
export const CART = '/cart';
export const CATALOG_CATEGORY = `{CATALOG}/:productID`;
export const CHECKOUT = '/checkout';
export const VIEW_ONE = ''

export const NAV = [
    {
        title: 'home',
        url: ROOT,
    },
    {
        title: 'catalog',
        url: CATALOG,
        children: [
            {
                title: 'view element',
                url: VIEW_ONE,
            },
        ]
    },
    {
        title: 'cart',
        url: CART,
    },
    {
        title: 'checkout',
        url: CHECKOUT,
    },

];
